import { useContext} from "react";
import useFetchData from "../Http/GetData";
import CardData from "./CardData";
function Home() {
  const context=useFetchData('home');
  context.map(e=>console.log(e.title))
  return (
    <CardData contextData={context}/>
  );
}

export default Home;
